'use strict';
let InstrumentDescriptor = require('./InstrumentDescriptor.js');
class InstrumentDescriptorBuilder extends InstrumentDescriptor {
    setOfferId(offerId) {
        this.offerId = offerId;
    }
    setSymbol(symbol) {
        this.symbol = symbol;
    }
    setSortOrder(sortOrder) {
        this.sortOrder = sortOrder;
    }
    setPriceStreamId(priceStreamId) {
        this.priceStreamId = priceStreamId;
    }
    setSubscriptionStatus(subscriptionStatus) {
        this.subscriptionStatus = subscriptionStatus;
    }
    build() {
        return this;
    }
}
module.exports = InstrumentDescriptorBuilder
